import React from 'react';
import HomeNavbar from '../components/HomeNavbar';  // Importing the new HomeNavbar

function HomePage() {
  return (
    <div>
      <div className="absolute top-0 left-0 w-full z-10">
        <HomeNavbar />
      </div>
    </div>
  );
}

export default HomePage;
